import structures



def translate_to_aminoacid(sequence, start_index=0):
    return [structures.RNA_Codons[sequence[index:index + 3]] for index in
            range(start_index, len(sequence) - 2, 3)]


if __name__ == '__main__':
    print(str(translate_to_aminoacid(''))
          .replace(',', '')
          .replace('\'', '')
          .replace(' ', ''))